import { Injectable } from '@angular/core';
import { Board } from '../models/board';

@Injectable({
  providedIn: 'root'
})
export class BoardService {

  private board: Board = {
    boardName: "My trello board"
  }

  constructor() { }

  public getBoardName() : string {
    return this.board.boardName;
  }

}
